class WebAppDock {
    constructor(webAppPlugin) {
        this.webAppPlugin = webAppPlugin;
        this.createIcon();
        this.createDock();
    }

    createIcon() {
        const svg = `
       <path d="M371.733 94.172q25.773 0 44.112 17.843t18.339 43.617v247.822q0 25.773-18.339 44.112t-44.112 18.34H123.91q-25.774 0-43.617-18.34t-17.843-44.112V155.632q0-25.773 17.843-43.617t43.617-17.843h247.822z m0 495.644q25.773 0 44.112 17.843t18.339 43.617v248.813q0 25.774-18.339 43.617t-44.112 17.843H123.91q-25.774 0-43.617-17.843t-17.843-43.617V651.276q0-25.774 17.843-43.617t43.617-17.843h247.822z m496.635 0q25.773 0 43.617 17.843t17.843 43.617v248.813q0 25.774-17.843 43.617t-43.617 17.843H620.546q-25.773 0-44.112-17.843t-18.34-43.617V651.276q0-25.774 18.34-43.617t44.112-17.843h247.822z m137.789-386.602q19.826 19.826 19.826 46.59t-19.826 45.6l-184.38 184.38q-19.825 19.825-46.095 19.825t-46.094-19.826l-184.38-184.38q-18.834-18.834-18.834-45.599t18.834-46.59l184.38-184.38Q749.413 0 775.682 0t46.095 18.834z"></path>
        `;
        registerIcon('iconWebApp', '1024', svg);
    }

    createDock() {
            const dock = this;
            const plugin = this.webAppPlugin;
            this.webAppPlugin.addDock({
                        config: {
                            position: "LeftBottom",
                            size: { width: 200, height: 0 },
                            icon: "iconWebApp",
                            title: "Web应用",
                        },
                        data: {
                            apps: this.webAppPlugin.apps,
                        },
                        type: 'WebAppDock',
                        init() {
                            const render = () => {
                                    this.element.innerHTML = `<div class="fn__flex-1 fn__flex-column">
                            <style>
                        .plugin-webapp_custom-dock {
                            padding: 0px;
                        }
                        .plugin-webapp_custom-dock .webapp {
                            padding: 4px;
                            margin: 2px 6px;
                            font-size: 16px;
                        }
                        .plugin-webapp_custom-dock .webapp:hover {
                            cursor: pointer;
                            border-radius: 4px;
                            background-color: var(--b3-list-background);
                        }
                        .plugin-webapp_custom-dock .webapp {

                    }
                    .plugin-webapp_custom-dock .webapp svg {
                        width: 14px;
                        height: 14px;
                        margin-right: 6px;
                    }
                    </style>
                    <div class="block__icons">
                        <div class="block__logo">
                            <svg><use xlink:href="#iconWebApp"></use></svg>
                            Web应用
                        </div>
                        <span class="fn__flex-1 fn__space"></span>
                        <span data-type="min" class="block__icon b3-tooltips b3-tooltips__sw" aria-label="最小化"><svg><use xlink:href="#iconMin"></use></svg></span>
                        <span id="add-webapp" class="block__icon b3-tooltips b3-tooltips__sw" aria-label="新建"><svg><use xlink:href="#iconAdd"></use></svg></span>
                    </div>
                    
                    <div class="fn__flex-1 plugin-webapp_custom-dock">
                        ${this.data.apps.map((app) => {
                        return `<div class="webapp" data-name="${app.name}"><svg><use xlink:href="#${app.iconName}"></use></svg>
                                <span>${app.title}</span>
                                ${app.internal ? '' : `<span class="deleteapp b3-tooltips b3-tooltips__w" aria-label="删除" data-name="${app.name}"><svg><use xlink:href="#iconTrashcan"></use></svg></span>`}
                            </div>`
                    }).join('')}
                    </div>
                </div>`;
                    const webapps = this.element.querySelectorAll('.webapp');
                    for (const appEl of webapps) {
                        appEl.addEventListener('click', () => {
                            const app = this.data.apps.find((v) => v.name === appEl.getAttribute('data-name'));
                            if (app) {
                                app.openTab();
                            }
                        })
                    }
                    const deleteapps = this.element.querySelectorAll('.deleteapp');
                    for (const del of deleteapps) {
                        del.addEventListener('click', (e) => {
                            e.preventDefault();
                            e.stopPropagation();
                            let target;
                            for (const f of e.path) {
                                if (f.classList.contains('deleteapp')) {
                                    target = f;
                                    break;
                                }
                            }
                            if (!target) {
                                return;
                            }
                            const name = target.getAttribute('data-name');
                            plugin.remove(name);
                        });
                    }
                    const add = this.element.querySelector('#add-webapp');
                    add.addEventListener('click', () => dock.addWebApp());
                }

                dock.el = this.element;
                dock.render = render;

                render();
            },
        });

    }

    refresh() {
        this.render && this.render();
    }

    addWebApp() {
        const dock = this;
        const plugin = this.webAppPlugin;
        const dialog = new Dialog({
            title: '添加Web应用',
            content: `
            <div class="b3-dialog__content">
                <div class="b3-dialog-input">
                <label for="appname">名称</label>
                <input class="b3-text-field fn__block" type="input" name="appname" id="appname"/>
                </div>
                <div class="b3-dialog-input">
                <label for="appurl">URL</label>
                <input class="b3-text-field fn__block" type="input" name="appurl"  id="appurl"/>
                </div>
                <div class="b3-dialog-input">
                <label for="appfile">LOGO</label>
                <input class="fn__block" type="file" name="appfile"  id="appfile"/>
                </div>
            </div>
            <div class="b3-dialog__content">
            <p>使用说明:\n注意：输入名称仅支持英文，url请输入完整https或http协议链接。选择图片尽量为正方形，均完成后点击添加按钮。</p>
            </div>
            <div class="b3-dialog__action">
                <button class="b3-button b3-button--cancel">取消</button><div class="fn__space"></div>
                <button class="b3-button b3-button--text">添加</button>
            </div>`,
            width: "520px",
        });
        const nameEl = dialog.element.querySelector("#appname");
        const urlEl = dialog.element.querySelector("#appurl");
        const fileEl = dialog.element.querySelector("#appfile");

        const btnsElement = dialog.element.querySelectorAll(".b3-button");
        // inputElement.focus();
        btnsElement[0].addEventListener("click", () => {
            dialog.destroy();
        });
        btnsElement[1].addEventListener("click", async () => {
            try {
                const res = await readImageAsBase64(fileEl);
                const name = nameEl.value
                const options = {
                    name: name,
                    iconName: `icon${name}`,
                    iconSvg: `<image href="${res.url}" />`,
                    iconSymbolSize: res.size,
                    title: name,
                    isTopBar: true,
                    topBarPostion: "right",
                    url: urlEl.value,
                };
                plugin.addApp(options);
                dialog.destroy();
                dock.refresh();
            } catch (e) {
                console.error(e);
                return;
            }
        });
    }

    save(options) {
        this.webAppPlugin.addApp(options);
    }
}

module.exports = class WebAppPlugin extends Plugin {
    constructor(options) {
        super(options);
        this.webAppDock = new WebAppDock(this);
    }

    apps = [flomo, cubox, dida, ChatDOC];

    appsConfig = [];

    async onload() {
        this.apps.forEach((app) => app.internal = true);
        await this.initStorage();
        this.apps.forEach((app) => this.loadApp(app));
    }

    async initStorage() {
        const data = await this.loadData('apps.txt');
        if (!data) {
            await this.saveData('apps.txt', '[]');
        } else {
            try {
                const arr = JSON.parse(data);
                arr.forEach((conf) => {
                    this.appsConfig.push(conf);
                    this.apps.push(new WebApp(conf))
                });
                this.webAppDock.refresh();
            } catch (e) {
                console.error('web app 解析失败', e);
            }
        }
    }

    async updateStorage() {
        const s = JSON.stringify(this.appsConfig, null, 2);
        await this.saveData('apps.txt', s);
    }

    addApp(options) {
        const app = new WebApp(options);
        this.loadApp(app);
        this.apps.push(app);
        this.appsConfig.push(options);
        this.updateStorage();
    }

    async remove(name) {
        const i = this.apps.findIndex((v) => v.name === name);
        if (i >= 0) {
            this.apps.splice(i, 1);
        }
        const j = this.appsConfig.findIndex((v) => v.name === name);
        if (j >= 0) {
            this.appsConfig.splice(j, 1);
        }
        await this.updateStorage();
        this.webAppDock.refresh();
    }

    loadApp(app) {
        if (app.isTopBar) {
            const tab = this.addTab({
                type: app.name,
                init() {
                    this.element.innerHTML = `<div style="display: flex" class="fn__flex-column fn__flex fn__flex-1 ${this.data.name}__custom-tab">
                        <webview allowfullscreen allowpopups style="border: none" class="fn__flex-column fn__flex  fn__flex-1" src="${this.data.url}"></webview>
                    </div>`;

                    if (this.data.script) {
                        const webview = this.element.querySelector('webview');
                        webview.addEventListener('load-commit', () => {
                            const ps = webview.executeJavaScript(this.data.script);
                            if (this.data.debug);
                            ps.then(console.log);
                        });
                    }

                    if (this.data.debug) {
                        const webview = this.element.querySelector('webview');
                        webview.addEventListener('dom-ready', () => {
                            webview.openDevTools()
                        });
                    }

                    const panel = this.element.querySelector(`.${this.data.name}__custom-tab`);

                    function 隐藏遮罩() {
                        panel.querySelector(".ovelayer")
                            ? panel.querySelector(".ovelayer").remove()
                            : null;
                    }
                    function 显示遮罩() {
                        if (!panel.querySelector(".ovelayer")) {
                            let div = document.createElement("div");
                            div.setAttribute(
                                "style",
                                `position:absolute;bottom:0;left:0;height:${panel.clientHeight}px;width:100%`
                            );
                            div.setAttribute("class", "ovelayer");
                            div.addEventListener("mousedown", () => {
                                siyuanMenu.close();
                            });
                            panel.appendChild(div);
                        }
                    }
                    document.addEventListener(
                        "mousedown",
                        () => {
                            显示遮罩();
                        },
                        true
                    );
                    document.addEventListener(
                        "mouseup",
                        () => {
                            隐藏遮罩();
                        },
                        true
                    );
                }
            });
            app.openTab = () => openTab({
                custom: {
                    icon: app.iconName,
                    title: app.title,
                    data: {
                        name: app.name,
                        url: app.url,
                        script: app.script,
                        debug: app.debug,
                    },
                    fn: tab,
                },
            });
            return;
        }
    }
}